import React from "react";
import "./Finish.css";
import background from "./background.png";
import FinishIcon from "@material-ui/icons/CheckCircleOutline";

function Finish() {
  return (
    <div className="finish" style={{ backgroundImage: `url(${background})` }}>
      <div className="finish__amazonLogo">
        <img className="finish__logo" src="" />

        <div className="finish__text">
          <h1 className="finish__aboutShopping">
            Congratulations,
            <br />
            your purchase was a success!
            <br />
            We hope you will make
            <br />
            your next purchases
            <br />
            with us as well ...
          </h1>
        </div>
        <div className="finish__buttonBox">
          <button className="finish__button">FINISH</button>
          <FinishIcon className="finish__icon" />
        </div>
      </div>
    </div>
  );
}

export default Finish;

